const Funky=()=>{
    const fullName={
        fname: "shashwat",
        lname: "sharma"
    }
    const bioData={
        id:  1,
        ...fullName,
        age: 26,
        gender: "male"
    }
    return(
        <><h1>My Biodata</h1>
           <span> bioData</span>
        </>
    );
}
export default Funky;
